package com.web.comment.unit;/** * @描述: * @版权: Copyright (c) 2016-2018 * @公司: lumi * @作者: 泽林 * @创建日期: 2018-10-19 * @创建时间: 下午3:55 */public class ResultDto {    private long code;    private String msg;    private Object data;    public ResultDto( ){    }    public ResultDto( long code , String msg ){        this.code = code;        this.msg = msg;    }    public ResultDto( long code , Object data ){        this.code = code;        this.data = data;    }    public ResultDto( long code , String msg , Object data ){        this.code = code;        this.msg = msg;        this.data = data;    }    public long getCode( ){        return this.code;    }    public void setCode( long code ){        this.code = code;    }    public String getMsg( ){        return this.msg;    }    public void setMsg( String msg ){        this.msg = msg;    }    public Object getData( ){        return this.data;    }    public void setData( Object data ){        this.data = data;    }    @Override    public String toString( ){        return "ResultDto{code=" + this.code + ", msg='" + this.msg + '\'' + ", data=" + this.data + '}';    }}